import React, { Component } from 'react'

export default class YoutubeVideo extends Component {

    constructor() {
        super();
        this.state = {
            allDetails: {},
            videoID: "",
            title: "test",
            imageSrc: "what",
        }
    }

    componentWillMount() {
        this.state.allDetails = this.props.videoDetails;
        var videoID = "#" + this.state.allDetails['resourceId']['videoId']
        this.setState({ videoID: videoID });
        this.setState({ title: this.state.allDetails['title'] })
        this.setState({ imageSrc: this.state.allDetails['thumbnails']['medium']['url'] })
        console.log(this.state.allDetails['thumbnails']);
    }


    render() {
        return (
            <div>
                <img src={this.state.imageSrc} alt="new" className="img-fluid" />
                {this.state.title}
                <button type="button" className="btn btn-danger" data-toggle="modal" data-target={this.state.videoID}>

                    {this.state.videoID}
                </button>
            </div>
        )
    }
}
